import axios from 'axios';

const axiosInstance = axios.create({
	baseURL: "https://wuhan-coronavirus-api.laeyoung.endpoint.ainize.ai/jhu-edu/timeseries",
	headers: {
		'Content-Type': 'application/json;charset=UTF-8',
	}
}); 

export function getTimeseriesData(iso2) {
	return axiosInstance({
		method: "GET",
		params: {
			iso2,
			onlyCountries:true,
		}
	})
	.then((response) => {
		return response;
	}, (error) => {
		throw Error(error);
	});
}
